import React from 'react';
import { Fragment } from 'react';

function DataImportation() {

  document.getElementById('relation').addEventListener('click', DataImportation);

  function DataImportation(){
    fetch('AFD.txt')
    .then(function(response){
      return response.text();
    })
    .then(function(relation){
      console.log(relation);
      document.getElementById('result').innerHTML = relation;
    })
    .catch(function(error){
      console.log(error)
    })
  }

  return (
      <div className='DataImportation'>
       <Fragment>
          <div class="container">
            <button id="relation">Importação de Dados</button>
          </div>
          <div id="result"></div>
       </Fragment>
      </div>
    );
  }



  export default DataImportation;
